// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "./Registro.sol";

contract Campaign {
    string nome;
    address crowdsourcerAddress;
    int256 internal lat;
    int256 internal lng;
    int256 internal range;
    string internal campaignType;
    int256 numProducers;
    Registro public registro;



   struct ProducerSelezionato {
    address deviceAddress;
    int256 reputazione;
    int256 score;
    }   





    ProducerSelezionato[] public producersTop;

   

    struct Data {
    address producerAddress;
    int256 dataValue; // valore del dato prodotto, come temperatura, pressione, ecc.
    uint256 timestamp; // timestamp per registrare quando è stato prodotto il dato
    }


   
    //Producer[] producersTop;
    mapping(address => Data) public producerData;
    bytes32 seme;
    bytes public proof;
    bool valid = false;

    constructor(string memory nomeC,address  crowdsourcer,int256 latitudine,int256 longitudine,int256 ran,string memory camptype,int256 numeroProducers,address _registroAddress) {
        nome = nomeC;
        crowdsourcerAddress = crowdsourcer;
        lat = latitudine;
        lng = longitudine;
        range = ran;
        campaignType = camptype;
        numProducers = numeroProducers;
        registro = Registro(_registroAddress);
       
    }


     function setProducersTop(ProducerSelezionato[] memory producersT) public {
        delete producersTop;

        for (uint256 i = 0; i < producersT.length; i++) {
            producersTop.push(producersT[i]);
        }
    } 

    function getProducersTop() public view returns(ProducerSelezionato[] memory){
        return producersTop;
    }

    function getProducersTopCount() public view returns (uint256) {
        return producersTop.length;
    }



/*
    function registerProducer(address producerAddress, int256 rep) public {
    Producer memory producer = Producer({
        addressDevice : producerAddress,
        reputazione : rep
    });
        producers.push(producer);

    } */



    function addData(int256 dataValue,address addrProd) public {
        require(valid == true, "La campagna non e' valida");
        require(isProducerRegistered(addrProd), "Producer non registrato");

        Data memory newData = Data({
            producerAddress: addrProd,
            dataValue: dataValue,
            timestamp: block.timestamp
        });

        producerData[addrProd] = newData;
    }

    function getProducerData(address producerAddress) public view returns (Data memory) {
        return producerData[producerAddress];
    }

    function isProducerRegistered(address producer) internal view returns (bool) {
        for (uint256 i = 0; i < producersTop.length; i++) {
            if (producersTop[i].deviceAddress == producer) {
                return true;
            }
        }
        return false;
    }
    

    function checkAndUpdate(int256 tolleranza) public {
    require(valid == true, "La campagna non e' valida");
    for (uint256 i = 0; i < producersTop.length; i++) {
        address producerAddress = producersTop[i].deviceAddress;
        require(producerData[producerAddress].timestamp != 0, "Dati non inviati da tutti i produttori selezionati");
    }

    int256[] memory values = new int256[](producersTop.length);
    for (uint256 i = 0; i < producersTop.length; i++) {
        values[i] = producerData[producersTop[i].deviceAddress].dataValue;
    }

    // Chiama update nel contratto Registro
    registro.update(values, tolleranza);
}



   function getNomeCampagna() public view returns (string memory) {
    return nome;
}


    /*
    function getProducersCount() public view returns (uint256) {
        return producers.length;
    }  */

/*
