        return producersTop;
    }

     function setProducersTop(Producer[] memory producersT) public {
        delete producersTop;

        for (uint256 i = 0; i < producersT.length; i++) {
            producersTop.push(producersT[i]);
        }
    } */

    function setSemeProof(bytes32  Seed,bytes memory p) public{
        seme = Seed;
        proof = p;

    }
    function setValid() public{
        valid = true;
    }

    function getValid() public view returns (bool){
        return valid;
    }

    function getSeme() public view returns (bytes32){
        return seme;
    }

/*
