        address[] memory addresses = new address[](producersTop.length);
        for (uint256 i = 0; i < producersTop.length; i++) {
            addresses[i] = producersTop[i].addressDevice;
        }
        return addresses;
    }


    function UpdateReputation(address[] memory addr,int256[] memory rep) public{
        for(uint256 i = 0;i<addr.length;i++){
            for(uint j = 0;j<producers.length;j++){
                if(addr[i] == producers[j].addressDevice){
                    producers[j].reputazione = rep[i];
                }
