// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;

import "./Campaign.sol";

contract CampaignFactory {
    address[] public campaigns;

    function createCampaign(string memory nomeC, address crowdsourcer,int256 latitudine,int256 longitudine,int256 ran,string memory camptype,int256 numeroProd,address registroAddress) public {
        Campaign newCampaign = new Campaign(nomeC, crowdsourcer,latitudine,longitudine,ran,camptype,numeroProd,registroAddress);
        campaigns.push(address(newCampaign));
    }

    function getAllCampaigns() public view returns (address[] memory) {
        return campaigns;
    }
}

