// SPDX-License-Identifier: MIT

pragma solidity ^0.8.24;





import "../prb/contracts/PRBMathSD59x18.sol";


contract Registro {
    struct Producer {
        address addressDevice;
        int256 reputazione;
    }

    mapping(address => Producer) public producers;
    address[] public producerAddresses;
    using PRBMathSD59x18 for uint256;

    
    function registerProducer(address _addressDevice, int256 _reputazione) public {
        require(producers[_addressDevice].addressDevice == address(0), "Producer already registered");
        producers[_addressDevice] = Producer(_addressDevice, _reputazione);
        producerAddresses.push(_addressDevice);
    }

    function getProducerCount() public view returns (uint256) {
        return producerAddresses.length;
    }

    function getAllProducers() public view returns (Producer[] memory) {
        Producer[] memory allProducers = new Producer[](producerAddresses.length);
        for (uint256 i = 0; i < producerAddresses.length; i++) {
            allProducers[i] = producers[producerAddresses[i]];
        }
        return allProducers;
    }

    function UpdateReputations(address[] memory _addressDevice,int256[] memory rep) public{
        for(uint256 i=0;i<_addressDevice.length;i++){
            producers[_addressDevice[i]].reputazione = rep[i];
        }
    }

     function mediana(int256[] memory val) public pure returns (int256) {
        int256[] memory c = val;
        sort(c); // Ordina l'array
        uint256 mid = c.length / 2;
        if (c.length % 2 == 0) {
            return (c[mid] + c[mid - 1]) / 2;
        } else {
            return c[mid];
        }
    }

     function sort(int256[] memory arr) internal pure {
        uint256 len = arr.length;
        for (uint256 i = 0; i < len; i++) {
            for (uint256 j = i + 1; j < len; j++) {
                if (arr[i] > arr[j]) {
                    int256 temp = arr[i];
                    arr[i] = arr[j];
                    arr[j] = temp;
                }
            }
        }
    }

     function score(int256[] memory val, int256 medianaVal) public pure returns (int256[] memory) {
        int256[] memory scoreArray = new int256[](val.length);
        for (uint256 i = 0; i < val.length; i++) {
            if(val[i] >= medianaVal){
                 scoreArray[i] = val[i] - medianaVal;
            } else{
            scoreArray[i] = medianaVal - val[i];    
            }
           
        }
        return scoreArray;
    }



function constraintFunction(int256 _score, int256 tolleranza) public pure returns (int256) {
    // Calcola il quadrato di `_score` e `tolleranza`
    int256 scoreSquared = _score ** 2;
    int256 tolleranzaSquared = tolleranza ** 2;

    // Usa PRBMath per calcolare `ratio` come valore a precisione fissa
    int256 ratio = PRBMathSD59x18.div(scoreSquared * 1e18, tolleranzaSquared);

    // Riduci il termine costante a 1e17 per amplificare l’effetto del `ratio`
    int256 denom = 1e18 + ratio;

    // Calcola `result` con PRBMath per una divisione precisa
    int256 result = PRBMathSD59x18.div(2e18 * 1e18, denom) - 1e18;
    return result;
}


    function finalReputation(int256 newValue,int256 oldReputation,int256 peso) public pure returns (int256){
         int256 finalRep = (peso * newValue / 1e18) + ((1e18 - peso) * oldReputation / 1e18);
        return finalRep; 
    }


    function update(int256[] memory val,int256 tolleranza) public{
        int256 medianaVal = mediana(val);
        int256[] memory scoreArray = score(val,medianaVal);
       uint256 length = scoreArray.length;

        int256[] memory ratings = new int256[](length);
        int256[] memory finalReputations = new int256[] (length);
        for(uint256 i=0;i<length;i++){
            ratings[i] = constraintFunction(scoreArray[i],tolleranza);
            address producerAddress = producerAddresses[i];
            int256 currentReputation = producers[producerAddress].reputazione;
            finalReputations[i] = finalReputation(ratings[i], currentReputation, 1e17);
            producers[producerAddress].reputazione = finalReputations[i];
            //finalReputations[i] = finalReputation(ratings[i])
        }

    }
}

